import React from 'react'

export default class extends React.Component {
    render() {
        return (
            <div>
                <img src=" /platzi-logo.png" alt="" />
                <h1>Created by Zunirry</h1>

                <style jsx >{`
                    :global(body) {
                    color: #1A2A35;
                    }

                    h1{
                        color: red;
                    }
                `}</style>
                <style jsx global>{`
                    body {
                    color: #1A2A35;
                    }

                `}</style>
            </div>
        )
    }
}
